svg.script:
var squareArray=new Array();
var squareColorArray=new Array();
function printMap(){
    for (var i=0;i<squareColorArray.length;i++){
        var line="";
        for (var j=0;j<squareColorArray[i].length;j++){
            line=line+squareColorArray[i][j]+'\t';
        }
        console.log(line);
    }
}
function remove(_element){
    var _parentElement = _element.parentNode;
    if(_parentElement){
        _parentElement.removeChild(_element);
    }
}
function removeNeighbor(blockX,blockY){
    var queue=new Array();
    var readyToRemove=new Array();
    queue.push({'x':blockX,'y':blockY});
    var targetColor=squareColorArray[blockX][blockY];
    if (targetColor==0){
        return;
    }
    var alone=true;        
    if ((blockX+1)<9 && squareColorArray[blockX+1][blockY]>0 && squareColorArray[blockX+1][blockY]==targetColor){
        alone=false;
    }
    if ((blockX-1)>=0 && squareColorArray[blockX-1][blockY]>0 && squareColorArray[blockX-1][blockY]==targetColor){
        alone=false;
    }
    if ((blockY+1)<6 && squareColorArray[blockX][blockY+1]>0 && squareColorArray[blockX][blockY+1]==targetColor){
        alone=false;
    }
    if ((blockY-1)>=0 && squareColorArray[blockX][blockY-1]>0 && squareColorArray[blockX][blockY-1]==targetColor){
        alone=false;
    }
    if(alone){
        return;
    }

    while(queue.length>0){
        var center=queue.shift();
        var x=center['x'];
        var y=center['y'];            
        if ((x+1)<9 && squareColorArray[x+1][y]>0 && squareColorArray[x+1][y]==targetColor){
            queue.push({'x':x+1,'y':y});
        }
        if ((x-1)>=0 && squareColorArray[x-1][y]>0 && squareColorArray[x-1][y]==targetColor){
            queue.push({'x':x-1,'y':y});
        }
        if ((y+1)<6 && squareColorArray[x][y+1]>0 && squareColorArray[x][y+1]==targetColor){
            queue.push({'x':x,'y':y+1});
        }
        if ((y-1)>=0 && squareColorArray[x][y-1]>0 && squareColorArray[x][y-1]==targetColor){
            queue.push({'x':x,'y':y-1});
        }
        if(squareArray[x][y]){
            remove(squareArray[x][y]);
            squareArray[x][y]=null;
            squareColorArray[x][y]=0;
        }
    }
}
function goDownAndLeft(){
    /**This function can be optimized
     * Note if each column is empty, then when arranging blocks going down,
     * these columns could be jumped over.
     */

    //Left
    var emptyCol=new Array();
    for (var e1=0;e1<squareArray.length;e1++){
        empty=1;
        for (var e2=0;e2<squareArray[e1].length;e2++){
            empty &= (squareArray[e1][e2]==null);
        }
        emptyCol[e1]=empty;
    }


    for (var i=0;i<squareArray.length;i++){
        var thisEmpty=emptyCol[i];
        var rightEmpty=0;
        while(thisEmpty==1 && rightEmpty==0 ){
            // -------move
            for (var j=i;j<squareArray.length-1;j++){
                for (var k=0;k<squareArray[j].length;k++){
                    squareArray[j][k]=squareArray[j+1][k];
                    squareColorArray[j][k]=squareColorArray[j+1][k];
                }
                emptyCol[j]=emptyCol[j+1];
            }
            // -------fill zero
            for (var k=0;k<squareArray[squareArray.length-1].length;k++){
                squareArray[j][k]=null;
                squareColorArray[j][k]=0;
            }
            emptyCol[squareArray.length-1]=1;
            // -------check right empty
            thisEmpty=emptyCol[i];
            rightEmpty=1;
            for (var j=i;j<squareArray.length;j++){
                rightEmpty &= emptyCol[j];
            }
        }            
    }

    //Down
    for(var i=0;i<squareArray.length;i++){
        for (var j=squareArray[i].length-1;j>0;j--){
            var emptyAbove=0;
            while (emptyAbove==0 && squareArray[i][j]==null){
                // -------move
                for (var k=j;k>0;k--){
                    squareArray[i][k]=squareArray[i][k-1];
                    squareColorArray[i][k]=squareColorArray[i][k-1];
                }
                // -------fill zero
                squareArray[i][0]=null;
                squareColorArray[i][0]=0;
                // -------check above empty
                emptyAbove=1;
                for (var k=j;k>=0;k--){
                    emptyAbove &= (squareArray[i][k]==null);
                }
            }
        }
    }

    //visualize
    for (var i=0;i<squareArray.length;i++){
        for (var j=0;j<squareArray[i].length;j++){
            if (squareArray[i][j]!=null){
                squareArray[i][j].setAttributeNS(null,"x",i*80);
                squareArray[i][j].setAttributeNS(null,"y",j*80);
            }
        }
    }
}
function mClick(evt){
    var blockX=Math.floor(evt.x/80);
    var blockY=Math.floor(evt.y/80);
    console.log('click on block ('+blockX+','+blockY+')');
    removeNeighbor(blockX,blockY);
    goDownAndLeft();
}
function init(){
    var layer=document.getElementById("squareLayer");
    for(var i=0;i<9;i=i+1){
        squareArray[i]=new Array();
        squareColorArray[i]=new Array();
        for(var j=0;j<6;j=j+1){
            var xmlns = "http://www.w3.org/2000/svg";
            var elem = document.createElementNS(xmlns, "rect");

            var colorJudge= Math.random()*3;
            var color=null;
            if (colorJudge<=1){
                color="blue";
                squareColorArray[i][j]=1;
            }else if (colorJudge>1 && colorJudge<=2){
                color="red";
                squareColorArray[i][j]=2;
            }else{
                color="yellow";
                squareColorArray[i][j]=3;
            }
            elem.setAttributeNS(null,"fill",color);
            elem.setAttributeNS(null,"class",color);

            elem.setAttributeNS(null,"x",i*80);
            elem.setAttributeNS(null,"y",j*80);
            elem.setAttributeNS(null,"stroke","grey");
            elem.setAttributeNS(null,"stroke-width",3);
            elem.setAttributeNS(null,"width",80);
            elem.setAttributeNS(null,"height",80);

            var anime1 = document.createElementNS(xmlns, "animate");
            anime1.setAttributeNS(null,"begin","mouseover");
            anime1.setAttributeNS(null,"end","mouseout");
            anime1.setAttributeNS(null,"dur","1s");
            anime1.setAttributeNS(null,"repeatCount","indefinite");
            anime1.setAttributeNS(null,"attributeName","fill");
            anime1.setAttributeNS(null,"from",color);
            anime1.setAttributeNS(null,"to","light"+color);
            if (color==="red"){
                anime1.setAttributeNS(null,"to","pink");
            }
            anime1.setAttributeNS(null,"fill","remove");

            elem.appendChild(anime1);
            elem.addEventListener("click",mClick,false);
            layer.appendChild(elem);
            squareArray[i][j]=elem;
        }
    }
    console.log("init ok");
}
